import React, { useState } from "react";
import '../../pages/DoctorSearch/DoctorSearchPage.css';

const DoctorFilters = () => {
  const [genderOpen, setGenderOpen] = useState(false);
  const [experienceOpen, setExperienceOpen] = useState(false);
  const [allFiltersOpen, setAllFiltersOpen] = useState(false);
  const [relevanceOpen, setRelevanceOpen] = useState(false);

  const toggleDropdown = (filter) => {
    setGenderOpen(filter === "gender" ? !genderOpen : false);
    setExperienceOpen(filter === "experience" ? !experienceOpen : false);
    setAllFiltersOpen(filter === "allFilters" ? !allFiltersOpen : false);
    setRelevanceOpen(filter === "relevance" ? !relevanceOpen : false);
  };

  const renderDivider = () => <hr />;

  return (
    <div className="filter-bar-wrapper">
      <div className="filter-bar">
        {/* Gender Filter */}
        <div className="filter-card" onClick={() => toggleDropdown("gender")}>
          Gender ▾
          {genderOpen && (
            <div className="dropdown">
  <label className="dropdown-item"><input type="radio" name="gender" /> Male</label>
  <label className="dropdown-item"><input type="radio" name="gender" /> Female</label>
  {renderDivider()}
</div>

          )}
        </div>

        {/* Experience Filter */}
        <div className="filter-card" onClick={() => toggleDropdown("experience")}>
          Experience ▾
          {experienceOpen && (
            <div className="dropdown">
              <div className="dropdown-item"><input type="radio" name="experience" /> 0-5 years</div>
              <div className="dropdown-item"><input type="radio" name="experience" /> 5-10 years</div>
              <div className="dropdown-item"><input type="radio" name="experience" /> 10+ years</div>
              {renderDivider()}
            </div>
          )}
        </div>

        {/* All Filters */}
        <div className="filter-card" onClick={() => toggleDropdown("allFilters")}>
          All Filters ▾
        </div>

        {/* Relevance */}
        <div className="filter-card" onClick={() => toggleDropdown("relevance")}>
          Relevance ▾
          {relevanceOpen && (
            <div className="dropdown">
              <div className="dropdown-item"><input type="radio" name="relevance" /> Most Relevant</div>
              <div className="dropdown-item"><input type="radio" name="relevance" /> Highest Rated</div>
            </div>
          )}
        </div>
      </div>

      {/* Expanded All Filters Section */}
      {allFiltersOpen && (
        <div className="all-filters-section">
          {/* Associated Hospitals */}
          <div className="filters-group">
            <strong>Associated with top hospitals</strong>
            <label><input type="checkbox" /> Manipal Hospitals</label>
            <label><input type="checkbox" /> Apollo White Dental</label>
          </div>

          {/* Fees */}
          <div className="filters-group">
            <strong>Fees</strong>
            <label><input type="radio" name="fees" /> ₹0 - ₹500</label>
            <label><input type="radio" name="fees" /> Above ₹500</label>
            <label><input type="radio" name="fees" /> Above ₹1000</label>
            <label><input type="radio" name="fees" /> Above ₹2000</label>
          </div>

          {/* Availability */}
          <div className="filters-group">
            <strong>Availability</strong>
            <label><input type="radio" name="availability" /> Next 4 hours</label>
            <label><input type="radio" name="availability" /> Today</label>
            <label><input type="radio" name="availability" /> Tomorrow</label>
            <label><input type="radio" name="availability" /> Next 7 days</label>
          </div>

          {/* Consult Type */}
          <div className="filters-group">
            <strong>Consult Type</strong>
            <label><input type="radio" name="consult" /> Video Consult</label>
          </div>
        </div>
      )}
    </div>
  );
};

export default DoctorFilters;
